package script.db.groovy.mogu_admin


databaseChangeLog(logicalFilePath: 'script/db/groovy/mogu_admin/sysdictdata.groovy') {
    changeSet(id: '2021-12-02-t-sysdictdata', author: '15077731547@163.com') {
        createTable(tableName: "t_sys_dict_data", remarks: '字典数据表') {
            column(name: 'uid', type: 'VARCHAR(32)', remarks: '主键')
                    { constraints(primaryKey: true) }
            column(name: 'oid', type: 'INT(11)', remarks: '自增键oid')
                    { constraints(nullable: false) }
            column(name: 'dict_type_uid', type: 'VARCHAR(255)', remarks: '字典类型UID')
                    { constraints(nullable: true) }
            column(name: 'dict_label', type: 'VARCHAR(255)', remarks: '字典标签')
                    { constraints(nullable: true) }
            column(name: 'dict_value', type: 'VARCHAR(255)', remarks: '字典键值')
                    { constraints(nullable: true) }
            column(name: 'css_class', type: 'VARCHAR(255)', remarks: '样式属性（其他样式扩展）')
                    { constraints(nullable: true) }
            column(name: 'list_class', type: 'VARCHAR(255)', remarks: '表格回显样式')
                    { constraints(nullable: true) }
            column(name: 'is_default', type: 'TINYINT(1)', remarks: '是否默认（1是 0否）,默认为0', defaultValue: 0)
                    { constraints(nullable: true) }
            column(name: 'create_by_uid', type: 'VARCHAR(32)', remarks: '创建人UID')
                    { constraints(nullable: true) }
            column(name: 'update_by_uid', type: 'VARCHAR(32)', remarks: '最后更新人UID')
                    { constraints(nullable: true) }
            column(name: 'remark', type: 'VARCHAR(255)', remarks: '备注')
                    { constraints(nullable: true) }
            column(name: 'status', type: 'TINYINT(1)', remarks: '状态', defaultValue: 1)
                    { constraints(nullable: true) }
            column(name: 'create_time', type: 'TIMESTAMP', remarks: '创建时间', defaultValue: '0000-00-00 00:00:00')
                    { constraints(nullable: false) }
            column(name: 'update_time', type: 'TIMESTAMP', remarks: '更新时间', defaultValue: '0000-00-00 00:00:00')
                    { constraints(nullable: false) }
            column(name: 'is_publish', type: 'VARCHAR(1)', remarks: '是否发布(1:是，0:否)', defaultValue: '1')
                    { constraints(nullable: false) }
            column(name: 'sort', type: 'INT(11)', remarks: '排序字段', defaultValue: 0)
                    { constraints(nullable: false) }
        }

        createIndex(indexName: "idx_oid", tableName: "t_sys_dict_data") {
            column(name: "oid")
        }

        addAutoIncrement(tableName: "t_sys_dict_data", columnName: "oid", columnDataType: "INT(11)")

    }

